import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Grezz AI Writer</h1>
      <h3>Tell me what you want to rank for. I'll help create your content.</h3>
      <input placeholder='Enter a keyword [i.e. "meal delivery"]'></input>
      <button>start</button>
    </div>
  );
}

export default App;
